    for t in range(3, target + 1):
        b = t.bit_length()
        if t == 2 ** b - 1:
            A[t] = b
            continue
        for j in range(b - 1):
            A[t] = min(A[t], A[t - 2 ** (b - 1) + 2 ** j] + b - 0 + j + 2)
        if 2 ** b - 1 - t < t:
            A[t] = min(A[t], A[2 ** b - 1 - t] + b + 1)
    return A[target]

